- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XA\x1CLine 29 shows a transfer of $10,000
    to the Republican State Committee of Pennsylvania's Non Federal Account to correct
    for a $10,000 contribution from Christine Olson reported on Line 11(a) that was
    intended for the Non Federal Account by the contributor.  The transfer was made
    immediately after the error was found but not reported.  This amendment corrects
    that omission.  A letter dated August 4 has been sent to Christine Olson notifying
    her of the option to be refunded from the state account given the error in reporting
    discovered July 21.    Payments for Federal Payroll Taxes, Insurance Premium,
    Payroll Taxes and Net Salary were made for staff members spending less than 25%
    of their time on federal election activity or any activities in connection with
    a federal election. The Memo Item for the Union League of Philadelphia on Line
    21(a) was misreported as an expense for our Lincoln Day Dinner and therefore does
    not require Schedule H2.  As such the description was changed to Business Meeting
    to correct for the error and accurately describe the expense.  "
